[Portion of a parchment leaf from an antiphonary used as binder’s waste. Text and neums written in brown ink; 4-line staff and rubrics in red ink; initials in red and blue ink. Text and music probably for two of the hours of the feast of St. Maurice and companions (the Theban Legion or the Martyrs of Agaunum), September 22 (first and second nocturnes?).]
